import styled from "styled-components";
import classes from "./Button.module.css";

const ButtonArea = styled.button`
    font: inherit;
    border: 1px solid #4f005f;
    background: #4f005f;
    color: white;
    padding: 0.25rem 1rem;
    cursor: pointer;
    margin: 1rem 0.5rem ;

    &:hover,
    :active {
    background: #741188;
    border-color: #741188;
    }

   &:focus {
    outline: none;
    }
`



const Button = (props) => {
    return (
        <ButtonArea type="submit">{props.children}</ButtonArea>  
    )
}

export default Button;
